import React from "react";
import { FaArrowLeft, FaEnvelope, FaGoogle, FaApple } from "react-icons/fa";
import styles from "./Signup.module.css";

const Signup = () => {
  return (
    <>
      <div className={`${styles.signupHead}`}>
        <div className={`${styles.signupContent} mb-5`}>
          <div className="d-flex align-items-center">
            <FaArrowLeft size={20} />
          </div>
          <h3 className="m-0">Sign Up</h3>
        </div>
      </div>
    </>
  );
};

export default Signup;
